import React, { useState, useEffect } from "react";
import axios from 'axios';
import useCookie from '../Components/useCookie'
import { useParams } from 'react-router-dom';

import MenuNav from "../Components/MenuNav";

function Order() {
    const uidCookie = useCookie('userid');
    let { code } = useParams();
    return (
        <div className="order">
            <MenuNav />
                <div className="top">
                    <div>
                        <a className="back" href={`/me/${uidCookie}`}>
                            Назад
                        </a>
                    </div>
                    <div>
                        <div className="header">
                            <h5>Заказ №{code}</h5>
                        </div>
                    </div>
                </div>
            <div className="body">
                <aside>
                    <ul className="asideFilter">
                        <li>Профиль</li>
                        <li>Избранное</li>
                        <li>Питомцы</li>
                        <li>Заказы</li>
                    </ul>
                </aside>
            </div>
        </div>
    );
}

export default Order;
